import React,{Component} from 'react';
import {Table} from 'react-bootstrap';

export class Main extends Component {

    constructor(props){
        super(props);
        this.state={main:[]}
    }

    render(){
        return(
            <Table className="mt-4" striped bordered hover size="sm">
                <thead>
                    <tr>
                        <th>EmployeeId</th>
                        <th>FullName</th>
                        <th>Email</th>
                        <th>Password</th>
                        <th>Mobile</th>
                        <th>Address</th>
                    </tr>
                </thead>

                <tbody>
                    {main.map(emp=>
                        <tr> Key={emp.EmployeeId}
                        <td> Key={emp.EmployeeId}</td>
                        <td> Key={emp.FullName}</td>
                        <td> Key={emp.Email}</td>
                        <td> Key={emp.Password}</td>
                        <td> Key={emp.Mobile}</td>
                        <td> Key={emp.Address}</td>
                        </tr>
                        )}
                </tbody>
            </Table>
        )
    }
}
